- Freehold going concern and business;
- Arguably the best accommodation asset in Batemans Bay;
- 33 large, well maintained guest rooms plus generous 3-bedroom managers residence;
- Facilities include award winning Briar's Restaurant & Bar, Pool, Tennis Court, Gym, Games Room and Lounge;
- Conference Rooms offering a variety of sizes and configurations cater to corporate and leisure demand;
- Set on 10 acres of landscaped grounds, with master plan approval for 56 townhouse residential development;
- Currently run under management;
- Average Income over last 3 years of around $945,000;
- Huge potential for motivated owner operator to drive revenues and profitability.
- Expression of Interest closing 15th April, 2014.

We are pleased to offer this freestanding commercial building available for lease located in the centre of Parramatta CBD on near the corner of Hunter & O'Connell Street and only a short walk from the Train/Bus interchange, Parramatta Park, Westfield, Council Hunter Street car-park and the RSL car-park.

Key feature of this opportunity include:

- Building area: 471sqm* over four mezzanine levels;
- Prominent CBD location with quality office space and  air-conditioning;
- Ample signage opportunities and excellent natural light;
- Centrally located, close to all amenities and approximately 200m from Westfield (Kmart entrance) and;
- Ample off-street parking available.

Please contact Maria or Stephen the exclusive leasing agents from CBRE for further information or to arrange an inspection.
